script: |
  super -f text -I q6303.spq | sort > q6303.out

inputs:
  - name: q6303.spq
    data: |
      SELECT - col0 + - - col0 AS col2 FROM tab2 (FORMAT parquet) AS cor0 WHERE NOT ( NOT - col1 NOT IN ( - - col2 * - col1 + 94, col1 + col0, + - col0 ) );
  - name: tab2

outputs:
  - name: q6303.out
    data: |
      0
      0
      0
